import React from "react";
import TextField from "@material-ui/core/TextField";
import {generateLabel, generateName} from "./utils";

const ATextField = (props) => {
  return (
    <TextField
      id={generateName(this.props.name, this.props.label)}
      name={generateName(this.props.name, this.props.label)}
      label={generateLabel(this.props.label, this.props.name)}
      value={props.value}
    />
  );
};

export default ATextField;
